import React, { useState, useEffect } from 'react'
import './ShowExercises.css'
import Button from '@material-ui/core/Button'
import axios from 'axios'
import BaseTable, { Column } from 'react-base-table'
import 'react-base-table/styles.css'


function ShowExercises() {
  const [posts, setPosts] = useState([])

  useEffect(() => {
    axios.get('http://localhost:8080/api/v1/exercise')
      .then(res => {
        console.log(res)
        setPosts(res.data)
      })
      .catch(err => {
        console.log(err)
      })
  })

  return (
    <div className='exercises'>
      <h1>Here you can see all exercises you did in the past</h1>
        <BaseTable data={post.id} width={1000} height={500}>
          {posts.map(post => (
              <Column key={post.id} dataKey={post.date} width={100} />
          ))}
        </BaseTable>
    </div>
  )

}

export default ShowExercises
